import Axio from './AxiosCalls'

export default class Funciones{
    constructor(){
        this.data = null;
        this.filas = null;

    }

    datosTabla(params) {
        return Axio.get('getRef.do?'+params)
        .then((response)=>response.data)
        .then(function(data){
            this.data=data;
        }.bind(this))
    }
    objetificador(){
        var obj = {data};
        this.filas=JSON.stringify(obj);
    }
}
